	public Test()
	{
		Sorts sort = new Sorts();
		Object[] what = {i11,i12,i13,i14,i15,i21,i22,i23,i24,i25,i31,i32,i33,i34,i35};
		
		for (int i = 0; i < what.length; i++){

				long before = System.currentTimeMillis();	//get time now
				sort.radix((int[])what[i]);
				long after = System.currentTimeMillis();	//get new time
				long time = after - before; 	//calculate speed
				System.out.println("Radix Sort #" + i + ": " + time + "ms; items: " + ((int[])what[i]).length);
		}
			
		for (int i = 0; i < what.length; i++){
			long before = System.currentTimeMillis();	//get time before
			sort.quicksort((int[])what[i]);
			long after = System.currentTimeMillis();	//get new time
			System.out.println("Quick Time " + i + ": " + (after-before)+ "ms; items: " + ((int[])what[i]).length);
		}
		
		for (int i = 0; i < what.length; i++){
			long before = System.currentTimeMillis();	//get time before
			sort.mergesort((int[])what[i]);
			long after = System.currentTimeMillis();	//get new time
			long time = after - before; 	//calculate speed
			System.out.println("Merge Time " + i + ": " + time+ "ms; items: " + ((int[])what[i]).length);
		}
		
		for (int i = 0; i < what.length; i++){
			long before = System.currentTimeMillis();	//get time before
			sort.bubblesort((int[])what[i]);
			long after = System.currentTimeMillis();	//get new time
			long time = after - before; 	//calculate speed
			System.out.println("Bubble Time " + i + ": " + time+ "ms; items: " + ((int[])what[i]).length);
		}
		
	}

